window.bookSummaryJSON = "<p><b>Hugo Award Winner for Best Series</b></p> <p>A novella set in the hard-scrabble world of James S. A. Corey's <i>NYT </i>best-selling Expanse series, <i>Strange Dogs</i> follows a family of colonists on Laconia where a new generation of humanity struggles with the profound changes that come with making a home on an alien world. Now a Prime Original series.</p> <p>Like many before them, Cara and her family ventured through the gates as scientists and researchers, driven to carve out a new life and uncover the endless possibilities of the unexplored alien worlds now within reach.</p> <p>But soon the soldiers followed and under this new order Cara makes a discovery that will change everything.</p> <p><b>The Expanse</b></p> <ul> <li><i>Leviathan Wakes</i></li> <li><i>Caliban's War</i></li> <li><i>Abaddon's Gate</i></li> <li><i>Cibola Burn</i></li> <li><i>Nemesis Games</i></li> <li><i>Babylon's Ashes</i></li> <li><i>Persepolis Rising</i></li> <li><i>Tiamat's Wrath</i></li> <li><i>â€‹Leviathan Falls</i></li> <li><i>Memory's Legion</i></li> </ul> <p><b>The Expanse Short Fiction</b></p> <ul> <li><i>Drive</i></li> <li><i>The Butcher of Anderson Station</i></li> <li><i>Gods of Risk</i></li> <li><i>The Churn</i></li> <li><i>The Vital Abyss</i></li> <li><i>Strange Dogs</i></li> <li><i>Auberon</i></li> <li><i>The Sins of Our Fathers</i></li> </ul>"; 
